import React from "react";
import { BrowserRouter, Switch, Route } from 'react-router-dom';

import MainUsuario from './pages/aluno/main';

const Routes = () => (

    <BrowserRouter>
    <Switch>
        <Route exact path="/aluno" component={MainUsuario} />
    </Switch>
    </BrowserRouter>
)

export default Routes;
